css:
@-moz-document url-prefix("https://projecteuler.net/") {
#container{
	background:#002b36;
	color:#839496;
}
#header{
	background:#073642;
	box-shadow:0 2px 5px #073642;
	color:#839496;
}
h2{
	color:#93a1a1;
}
h3{
	color:#586e75;
}
.problem_content{
	background-color:#002b36;
	border-top: solid 2px #073642;
	border-bottom: solid 2px #073642;
	border-left: solid 2px #073642;
	border-right: solid 2px #073642;
}
.problem_content p{
	color:#93a1a1;
}
.problem_content div{
	color:#839496;
}
input{
	background:#fdf6e3;
	color:#839496;
}
#about_page #disclaimer{
	background:#073642;
	color:#839496;
	border:2px solid #586e75;
}
a{
	color:#b58900
}
#nav li{
	background-color:#073642;
	border:1px solid #586e75;
	color:#839496;
}
#nav a{
	color:#839496;
}
#nav #current a{
	background-color:#002b36;
}
#nav #highlight{
	color:#cb4b16;
}
.grid th, .grid tr, .grid td{
	background-color:#073642;
	color:#839496;
	border-color:#586e75;
}
.age_days{
	color:#6c71c4 !important;
}
.age_hours{
	color:#cb4b16 !important;
}
.age_minutes{
	color:#dc322f !important;
}
html *{
	font-family: Source Code Pro !important;
}
}
